When Joe converts a value to a string, it does so via Joe::stringify. For proxied types, this defaults to returning the value's normal Java toString(). To change how a value is stringified at the script level, override TypeProxy::stringify. For example, NumberProxy ensures that integer-valued numbers are displayed without a trailing .0: @Override
